import { configureStore } from "@reduxjs/toolkit";

import downloadingSliceReducer from "./Slices/downloadingSlice.ts";
import sortSliceReducer from "./Slices/sortSlice.ts";
import transferCategorySliceReducer from "./Slices/transferCategorySlice.ts"
import companyCategorySliceReducer from "./Slices/companyCategorySlice.ts"
import ticketSliceReducer from "./Slices/ticketSlice.ts"

export const store = configureStore({
  reducer: {
    downloading: downloadingSliceReducer,
    sorting: sortSliceReducer,
    transferSorting: transferCategorySliceReducer,
    companySorting: companyCategorySliceReducer,
    ticketSort: ticketSliceReducer
  },
});
